export const getCartData = async () => {
  let data = []
  try {
    const res = await fetch("../public/Cart.json", {
      headers: {
        'Cache-Control': 'no-cache', // Disable caching
        'Pragma': 'no-cache',
        'Content-Type': 'application/json'
      },
    })
    alert(res)

    
  }
  catch (error) {
    console.log(error)
  }
  return data
}
